     "html": "<p><br /></p><h4 style=\"text-align:left\"><b>2.   WHO WILL HAVE ACCESS TO YOUR PRIVATE INFORMATION?</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Your private information will be used by and/or shared with the Research Team</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">In addition to the research team, if applicable, the following parties may receive your private information and inspect your records: </p>\n\n<ul style=\"font-size:16px;color:black\">\n<li>The reviewing Institutional Review Boards and Cedars-Sinai offices with authority to oversee research compliance.</li>\n<li>U.S. government agencies, such as the Food and Drug Administration and the Department of Health and Human Services.</li>\n<li>Researchers at other organizations who are participating in this research study.</li>\n<li>The Study Sponsor, its business partners, and Cedars-Sinai’s business partners for matters related to research study oversight, conduct of the research, data analysis, use of research results in product development, and payment or reimbursement.</li>\n<li>Representatives from regulatory agencies in other countries may join in the review of your research records, including research-related medical reports and information, with the Sponsor and/or the FDA.</li>\n</ul>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Cedars-Sinai takes steps to protect your private information when sharing it with the recipients described above. Though these steps and applicable law are meant to protect your private information, there is a risk that a recipient could share your private information without your permission.</p>\n\n<p><br /></p><h4 style=\"text-align:left\"><b>3.   WHEN WILL MY AUTHORIZATION EXPIRE?</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">By signing this document, you authorize the use and sharing of your private information until the end of the research studyand any related optional 